import classNames from 'classnames';
import types from 'prop-types';
import React from 'react';

// Styles

import './styles.scss';



export const Images = props => {

  return <div className="images-wrapper">
    <div className="image--big" style={{backgroundImage:`url(${props.firstImg})`}}></div>
    <div className="image">{props.secondImg}</div>
    <div className="image">{props.thirdImg}</div>
    <div className="image">{props.fourthImg}</div>
    <div className="image">{images.fifthImg}</div>
  </div>;
};



// Type of props

Images.propTypes = {
  prop: types.string,
};

// Default value for props

Images.defaultProps = {};
